    [],nt"revision_timestamp": "2016-07-27T23:03:16.724423",nt"name": "great-blue-herons-in-the-lake-champlain-ecosystem-an-assessment-of-the-rookeries-on-shad-i",nt"isopen":
    false,nt"url": null,nt"notes": "Lake Champlain is home to four Great Blue
    Heron rookeries, three large and one small. The Shad Island, Valcour Island and
    Porter Bay rookeries are large rookeries with over 100 nests while Island D of the
    Four Brothers Islands has only six Great Blue Heron nests. Although Four Brothers
    has only a few heron nests it is a large colony for gulls and Double-crested Cormorants.
    In 2003, studies of the rookeries at Valcour and Shad Islands to both monitor the
    status of these large and important rookeries and to assess the potential impact
    of cormorants on nesting Great Blue Herons. In addition nests in the other two rookeries
    were observed and counted to get a complete picture of the Great Blue Heron breeding
    population on Lake Champlain.",nt"license_title": "License Not Specified",nt"extras":
